import CarBrowsing from "./CarBrowsing";

const filterCars = (subcategory, setCars) => {
    fetch("http://localhost:3001/cars.json")
        .then((res) => res.json())
        .then((data) => {
        const result = data.filter((curData) => {
            return curData.subcategory === subcategory;
        });
        setCars(result);
        console.log();
        })
        .catch((error) => {
        console.error("Error fetching car.json:", error);
        });
    };


    export default filterCars;
